import React, { Component } from "react";
import { AppBar, Toolbar } from "@material-ui/core";

class Header extends Component {
  render() {
    return (
      <header id="home-top" className="nav-top nav-fixed nav-root">
        <div className="container">
          <div className="row">
            <div className="col-md-4 col-xs-4">
              <h1 id="header-logo" className="image-text">
                <a href="/">
                  <span className="mask"></span>
                  <span className="behind"></span>
                  Sean Halpin
                  <i className=""></i>
                </a>
              </h1>
            </div>
            <div className="col-md-8 col-xs-8">
              <nav id="top-nav">
                <ul className="nav-list transistion">
                  <li>
                    <a className="active" href="http://seanhalpin.io/">
                      About
                    </a>
                  </li>
                  <li>
                    <a href="http://seanhalpin.io/work">Work</a>
                  </li>
                  <li>
                    <a href="http://seanhalpin.io/notes">Notes</a>
                  </li>
                </ul>
              </nav>
            </div>
          </div>
        </div>
      </header>
    );
  }
}

export default Header;

